  false,\n\t\"url\": null,\n\t\"notes\": \"Report describes complete quantitative
  estimates of present and future migration and wintering habitat capability and waterfowl
  demand for each of 164 management units in the 48 coterminous United States. This
  report provides habitat capability estimates for each of these units. The two succeeding
  reports (FHMUP Reports 4 and 5) provide two complete estimates of waterfowl populations
  to provide two levels of waterfowl demand. In FHMUP Report 6 comparisons between
  habitat capability and waterfowl demand are displayed and the location and magnitude
  of problems associated with habitat deficiencies using information from this report
  are identified.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
